import React from 'react';
import axios from "axios";

const Home = () => {

    const [categories, setCategories] = useState([]);

    useEffect(()=>{
        axios('www.themealdb.com/api/json/v1/1/categories.php')
            .then(({data})=> setCategories(data.categories))
    },[]);

    return (
        <div>
            Home
            {categories.map((item)=>(
                <a href="">{item.strCategory}</a>
            ))}
        </div>
    );
};

export default Home;
